INSERT INTO `tbl_tulisan` (`tulisan_id`, `tulisan_judul`, `tulisan_isi`, `tulisan_tanggal`, `tulisan_kategori_id`, `tulisan_kategori_nama`, `tulisan_views`, `tulisan_gambar`, `tulisan_pengguna_id`, `tulisan_author`, `tulisan_img_slider`, `tulisan_slug`) VALUES (28,'Strategy of Values Education in the Indonesian Education System','<p><strong>ABSTRACT</strong></p>\r\n\r\n<p>&nbsp;The primary question of this research was how educators implement values education at Junior High Schools in Bangka Belitung Province, Indonesia. This research is a qualitative research with phenomenology type. Data analyzing technique used in this research was in-depth interviews, observation, and document analysis. Data analysis was done through data display, data reduction, and conclusion. The result showed that values education at Junior High School in Bangka Belitung started with the preparation of school vision based on values, and then the achievement of vision through the preparation of values education strategy. Habituation of values and values role model became the most dominant strategies used by principals and teachers to cultivate values. The results also showed that the values derived from religious teachings, namely the values of iman-taqwa (faith-piety) and good akhlaq (morals) were the most important values serve as a foundation in developing values education in schools. The big role of iman-taqwa (faith-piety) and good akhlaq (morals) values constitutes the effort done by the school to contribute in achieving the purposes of national education and curriculum of 2013. The final purpose of K-13 implementation and the national education system achievement is the formation of Indonesian whose strong faith and good morals.&nbsp;</p>\r\n\r\n<p>Link :&nbsp;<a href=\"https://doi.org/10.29333/iji.2019.12139a \">https://doi.org/10.29333/iji.2019.12139a&nbsp;</a></p>\r\n','2020-12-27 11:39:45',1,'Pendidikan',61,'0687b763ba483c0a246bb7d153964436.png',6,'Rumah Scopus',0,'strategy-of-values-education-in-the-indonesian-education-system'),(29,'Character Education Development Model based on Regional Culture ','<p><strong>ABSTRACT</strong></p>\r\n\r\n<p>The aim of the study was to find a culture-based character education model region in three major cities in Indonesia. The research method used is through qualitative descriptive supported by relevant literature studies and data from interviews, observation, and documentation in Surakarta City, Central Java, Denpasar, Bali, and West Jakarta. The results of this study are identification of city infrastructure that is suitable for child-based culture as; (1) the existence of artifacts containing art in accordance with the development of age children, in the city of Surakarta reaching 63%, in the city of Denpasar reaching 93%, and in the city of Jakarta West 60%; (2) The creation of a culture of being polite, friendly and ethical to each people in Surakarta city reach 77%, in Denpasar city it reaches 80%, in the city of West Jakarta reaching 73%; (3) Standard culture-based Child Friendly City, Denpasar, Bali 85%; in West Jakarta it reaches 66%; and in Surakarta city it reaches 90%. &nbsp;</p>\r\n\r\n<p>Link :&nbsp;<a href=\"https://www.jardcs.org/abstract.php?id=1193#\">https://www.jardcs.org/abstract.php?id=1193#</a></p>\r\n','2020-12-27 11:43:06',1,'Pendidikan',71,'d1fbae2c272364782c22f843bf391814.png',6,'Rumah Scopus',0,'character-education-development-model-based-on-regional-culture'),(30,'Becoming a principal in Indonesia possibility pitfalls and potential','<p><strong>ABSTRACT</strong></p>\r\n\r\n<p>The preparation and development of school leaders is now considered to be fundamental to school and system improvement. In the pursuit of educational change and reform, the leadership of the principal is deemed to be of critical importance. This qualitative study is part of a large scale research project that is exploring principal preparation and development in seven different countries. In particular, this article focuses on how public secondary school principals in Indonesia are prepared, developed and selected for their role. Disappointingly little is known from the empirical literature about being a principal in Indonesia or about principal preparation and development. Therefore this contemporary, descriptive, non-experimental qualitative study focused on a purposive sample of 18 public secondary school principals in four different provinces in Indonesia. The initial ?ndings reveal that even though principal training has been standardized in Indonesia and is now a compulsory part of a principal certi?cation process, micro-political in?uences still currently govern the appointment of school principals.</p>\r\n\r\n<p>Link :&nbsp;<a href=\"http://dx.doi.org/10.1080/02188791.2015.1056595\">http://dx.doi.org/10.1080/02188791.2015.1056595</a></p>\r\n','2020-12-27 11:49:46',1,'Pendidikan',45,'578642dc8a14c99c81e8c36b3cc5661f.png',6,'Rumah Scopus',0,'becoming-a-principal-in-indonesia-possibility-pitfalls-and-potential'),(31,'INVESTIGATING FACTORS OF DELAY IN IBS  CONSTRUCTION PROJECT: MANUFACTURER PERSPECTIVES ','<p><strong>ABSTRACT</strong></p>\r\n\r\n<p>Government of Malaysia has enthusiastically supported the implementation of Industrialized Building System (IBS) that was early introduced in 1960&rsquo;s. IBS is seen capable to ease the problem of delay that has been long haunting Malaysian construction industry. However, the issue of delay still exists even though IBS has been implemented in construction project and it is believed that there are other factors causing delay in IBS project. Thus, this paper aims to identify the factors of delay in IBS construction project through semi-structured interviews. Data on the study variables has been collected through interviews were conducted to explore the real-life construction situation in Malaysia. Factors of delay in IBS construction project are application of casting in-site by client, usage of dry mix cement, not fully implementation IBS method by clients in construction works, changes in design by client, delay in conforming the building design by client, delay in payment from client and delay of materials delivery from supplier. As an overall, results indicated that client-related factors are the most significant contributors in the delay of IBS project. The phenomena of delay in IBS construction project may require serious attention in overcoming the potential of<br />\r\ndelay factors and enhance the sustainability of IBS implementation in Malaysian construction industry.</p>\r\n\r\n<table cellpadding=\"3\">\r\n	<tbody>\r\n		<tr>\r\n			<td><a href=\"http://repo.uum.edu.my/id/eprint/26099\">http://repo.uum.edu.my/id/eprint/26099</a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','2020-12-27 11:54:43',1,'Pendidikan',84,'a915dd092883e7554773e1841a79973c.png',6,'Rumah Scopus',0,'investigating-factors-of-delay-in-ibs--construction-project:-manufacturer-perspectives'),(32,'Vocational Education Principal of Leadership: A Case Study in East Nusa Tenggara','<p><strong>ABSTRACT</strong></p>\r\n\r\n<p><br />\r\nThis paper proposes 5 principles of leadership reinforcement intervention for developing their leadership in the vocational education. The principles are drawn from a qualitative study in twenty-two (22) private and public vocational schools located in the province of East Nusa Tenggara. A total of 40 principals and senior school teachers participated in the study. The principles draw from their understanding and perception of leadership reinforcement. The leadership reinforcement requires the principals to have a clear vision in producing ready-to-work graduates. Principals reinforce their leadership by (1) enhancing the understanding of local wisdom, (2) benchmarking, (3) involving professional training, (4) instilling the beliefs, and (5) having a strong character with high integrity. The activities that mostly do are carrying out activities related to East Nusa Tenggara regional culture at school, involving directly the industry partners in the planning, process and distribution of graduates, participating the seminars or workshops related to strengthening leadership and management, giving good ethical examples and exemplary in actions and words, applying openness and transparency in making policies and decisions. Keywords: Leadership reinforcement; Vocational education; East nusa tenggara. &nbsp;</p>\r\n\r\n<p><a href=\"https://doi.org/10.32861/jssr.spi6.825.831\">Link :</a>&nbsp;<a href=\"https://doi.org/10.32861/jssr.spi6.825.831\">https://doi.org/10.32861/jssr.spi6.825.831</a></p>\r\n','2021-01-30 09:51:59',1,'Pendidikan',21,'14a42d9e8f10fa86370580594a3c32d1.png',6,'Rumah Scopus',0,'vocational-education-principal-of-leadership:-a-case-study-in-east-nusa-tenggara'),(33,'Vocational Schools Leadership Reinforcement Model','<p><strong>ABSTRACT</strong></p>\r\n\r\n<p>Al-Qur&rsquo;an is the main source and guideline in every worship and Muslim prayer. Similarly, how Islam provides basic understanding and concepts of leadership. In addition, vocational education is predicted to reduce unemployment among school graduates. Secondary vocational schools were blamed for failing to prepare students for the skilled workforce and eliminate the gap between the requirement of the industries and the competencies taught at school. This study examines school leadership reinforcement model for vocational secondary schools located in the Province of East Nusa Tenggara. This qualitative descriptive study employed development model for data collection. The observations and in-depth interviews were applied as prime data collection methods involving three (3) private and three (3) public vocational high schools. A total of 20 principals and senior school teachers participated in the study. The application of the school leadership reinforcement model requires the principals to have a clear vision in producing readyto-work graduates. These supporting institutions can provide valuable inputs to enable schools to produce appropriate output that matched with the requirements of the industries. Strengthening the school leadership can be in the form of understanding of the local culture, benchmarking other schools, providing professional training, instilling good ethics and building strong character with high integrity.<br />\r\nKeywords: Leadership; Teacher; East Nusa Tenggara; Integrity; Holy Quran</p>\r\n\r\n<p><a href=\"https://www.researchgate.net/publication/329470913_Vocational_schools_leadership_reinforcement_model\">Link :</a>&nbsp;<a href=\"https://www.researchgate.net/publication/329470913_Vocational_schools_leadership_reinforcement_model\">https://researchgate.net/publication/329470913_Vocational_schools_leadership_reinforcement_model</a></p>\r\n','2021-01-30 10:18:06',1,'Pendidikan',20,'4df5e5d84670a9bd219995e3f3f1c366.png',11,'Rumah Scopus',0,'vocational-schools-leadership-reinforcement-model'),(34,'Supply Chain Brown Sugar Agroindustry in Banyuwangi District: Analysis Study with a Dynamic System A','<p><strong>ABSTRACT</strong></p>\r\n\r\n<p>The purpose of this research is to find out the basic system in the supply chain, and the dynamic system of the brown sugar supply chain in Banyuwangi Regency. This research is a combination of explanatory research and causal research and uses a system dynamics approach by considering the GAP between supply and demand for local markets. Data analysis was performed using a dynamic system simulation using the powers program with a validation test through the calculation of Mean Absolute Percentage Error (MAPE). The final results show that the basic system of brown sugar agroindustry supply chain in the Banyuwagi Regency can be identified as actors, activities, and outputs. Until 2019, the demand for meeting local brown sugar needs is greater than the supply of brown sugar in the Banyuwangi Regency. To accelerate the fulfillment of local needs for brown sugar, it is necessary to increase the productivity of the sap juice subsystem as the main raw material for the brown sugar agroindustry subsystem in the Banyuwangi Regency.<br />\r\nKeywords- Supply Chain, Brown Sugar Agroindustry, Analysis Study, Dynamic System Approach, Banyuwangi</p>\r\n\r\n<p><a href=\"https://ojs.excelingtech.co.uk/index.php/IJSCM/article/view/4340\">Link :</a>&nbsp;<a href=\"https://ojs.excelingtech.co.uk/index.php/IJSCM/article/view/4340\">https://ojs.excelingtech.co.uk/index.php/IJSCM/article/view/4340</a><br />\r\n&nbsp;</p>\r\n','2021-01-30 10:25:02',1,'Pendidikan',30,'4bb5e3e72d50f6b5bee20fd34368188b.png',11,'Rumah Scopus',0,'supply-chain-brown-sugar-agroindustry-in-banyuwangi-district:-analysis-study-with-a-dynamic-system-a'),(35,'Increasing Speed and Agility of Cerebral Palsy Football Indonesian Player with UMAC-CPF Exercise Mod','<p><strong>ABSTRACT</strong></p>\r\n\r\n<p>This research aims to determine the increasing speed and agility of CP Football Indonesia team players using the Umar Motor Ability Circuit-Cerebral Palsy Football (UMAC-CPF) exercise model. The research method used was pre-experimental with research design, one group pretest, and posttest design. The sample of this research was 14 all-athletes of the cerebral palsy Indonesia team. The research data were obtained using a 20-meter sprint test instrument to measure speed and an arrowhead test to measure agility. The data&#39;s technical analysis was a t-test (hypothesis test) with a level of significance of 5%. The influence test results using the t-test of the difference in player speed test results between pretest and posttest obtained amount t-Count 4.921 more significant than the amount t-Table 1.761 (at the level of significance 0.05), then the nil hypothesis is rejected. While the test results influence the player&#39;s agility test results between pretest and posttest obtained amount t-Count 9.169 more significant than the amount t-Table 1.761 (at the level of significance 0.05), then the nil hypothesis is rejected. Both tests mean there is an increase in the speed and agility of CP Football Indonesia players. The study concluded a significant increase in the speed and agility of the player&#39;s football team of Cerebral Palsy Indonesia using the UMAC-CPF exercise model. The research&#39;s impact makes&nbsp;CP Football Indonesia team players have excellent speed and agility to improve motor skills in supporting the game.&nbsp;<br />\r\nKeywords &nbsp;Cerebral Palsy, Football, Speed, Agility, UMAC-CPF&nbsp;</p>\r\n\r\n<p><a href=\"http://10.13189/saj.2020.080604\">Link :</a>&nbsp;<a href=\"https://www.researchgate.net/publication/346646555_Increasing_Speed_and_Agility_of_Cerebral_Palsy_Football_Indonesian_Player_with_UMAC-CPF_Exercise_Model\">https://www.researchgate.net/publication/346646555_Increasing_Speed_and_Agility_of_Cerebral_Palsy_Football_Indonesian_Player_with_UMAC-CPF_Exercise_Model</a><br />\r\n&nbsp;</p>\r\n','2021-01-30 10:31:07',1,'Pendidikan',82,'d388b3edad7a78278a95df3efd96d0a9.png',11,'Rumah Scopus',0,'increasing-speed-and-agility-of-cerebral-palsy-football-indonesian-player-with-umac-cpf-exercise-mod'),(36,'Increasing Understanding of General Knowledge of Plastics with Video-based Learning ','<p><strong>ABSTRACT</strong></p>\r\n\r\n<p>This study was motivated by video-based learning materials on general knowledge, which is getting more popular. In many cases, video-based education is one of the best ways to learn in today&#39;s digital technology. The purpose of this study is to explore the increasing student understanding of learning general knowledge&nbsp; about plastics. This research was conducted using fundamental quantitative analysis in a video tutorial involving 28 respondents from polymer technology students at Mara University Technology (UiTM). The data were collected by giving tests to students before (pre-test) and after (post-test) watching the video. There are five questions students must answer. Data were collected and analysed using the Statistical Package for Science for<br />\r\nWindows software Version 21.0 (SPSS V21.0). The frequency and percentage are re-coded to compare the results between pre-test and post-test. A positive response&nbsp; means an increase in the ratio and the percentage of students who get the correct answer on the post-test. This treatment shows a positive response to video-based learning from students. The study results concluded that&nbsp; there was a significant increase compared to before and&nbsp;after the test. Instructional videos make the learning environment more attractive than textbook learning. In this way, learning can provide many benefits for students and teaching staff in increasing their understanding of general knowledge about plastics.&nbsp;<br />\r\nKeywords&nbsp;General Knowledge of Plastics,&nbsp;Thermoplastics, High-density Polyethylene Video-based Learning&nbsp;</p>\r\n\r\n<p><a href=\"https://www.researchgate.net/publication/346674509_Increasing_Understanding_of_General_Knowledge_of_Plastics_with_Video-based_Learning\">Link :</a>&nbsp;<a href=\"https://www.researchgate.net/publication/346674509_Increasing_Understanding_of_General_Knowledge_of_Plastics_with_Video-based_Learning\">https://www.researchgate.net/publication/346674509_Increasing_Understanding_of_General_Knowledge_of_Plastics_with_Video-based_Learning</a></p>\r\n','2021-01-30 10:38:06',1,'Pendidikan',71,'2ca4d7bbdb1d42618a41c8b8ab9cfbb3.png',11,'Rumah Scopus',0,'increasing-understanding-of-general-knowledge-of-plastics-with-video-based-learning'),(37,'Quickly Understanding on Progressive Muscle Relaxation with Video-based Learning in Secondary School','<p><strong>ABSTRACT</strong></p>\r\n\r\n<p>Progressive muscle relaxation can improve students&#39; learning performance in the classroom because it provides a good focus during classroom learning sessions&nbsp; in developing technical communication for educational institutions. This study aims to determine the effectiveness of video-based learning on the understanding of secondary school students related to Progressive Muscle Relaxation. The research was a quantitative descriptive method. Based on research that has been done, researchers found differences in students&#39; understanding between before and after watching videos related to progressive muscle relaxation. In this study, respondents need to answer questions raised by researchers before viewing the video and after watching the video. The respondents in this study&nbsp; were only six students. The percentage of respondents who answered the question correctly after seeing the video provided by the researcher rose quite significantly. Respondents are interested in the video provided, and respondents can understand the video content they want to&nbsp; convey. The use of video in teaching and learning is&nbsp;beneficial for students to increase their interest and demand Progressive Muscle Relaxation knowledge. Video-based learning can be implemented in teaching and learning in&nbsp; various fields of education. Visual lessons are more quickly remembered and understood by students. Learning to use videos can increase student&#39;s interest in learning new things.&nbsp;<br />\r\nKeywords &nbsp;Understanding, Progressive Muscle Relaxation, Video-based Learning, Secondary School Students&nbsp;</p>\r\n\r\n<p><a href=\"https://www.hrpub.org/journals/article_info.php?aid=9772\">Link :</a>&nbsp;<a href=\"https://www.hrpub.org/journals/article_info.php?aid=9772\">https://www.hrpub.org/journals/article_info.php?aid=9772</a></p>\r\n','2021-01-30 10:45:27',1,'Pendidikan',94,'87ad4d4b317acd50d7db416c1bd741ad.png',11,'Rumah Scopus',0,'quickly-understanding-on-progressive-muscle-relaxation-with-video-based-learning-in-secondary-school'),(38,'Instilling values of javanese leadership culture for primary school principal   ','<p><strong>ABSTRACT</strong></p>\r\n\r\n<p>The purpose of this study is to understand and know the views of the Principals in applying the values of Javanese cultural leadership Ki Hajar Dewantara. The research method uses approaches: historical, anthropological, and hermeneutic, with participant observation, indepth interviews, and documentation. As a result, there are similarities and differences of views by the principal towards the values of Javanese cultural leadership. In conclusion, school programs, management of artifacts, vision and mission are policy implications by the principal.&nbsp;</p>\r\n\r\n<p>Keywords : Leadership Values, Javanese Culture, Principal.&nbsp;</p>\r\n\r\n<p><a href=\"https://www.produccioncientificaluz.org/index.php/opcion/article/view/24781\">Link :</a>&nbsp;<a href=\"https://www.produccioncientificaluz.org/index.php/opcion/article/view/24781\">https://www.produccioncientificaluz.org/index.php/opcion/article/view/24781</a></p>\r\n','2021-01-30 11:01:04',1,'Pendidikan',116,'3d2e5b509b0c80941bfdb606f897208d.png',11,'Rumah Scopus',0,'instilling-values-of-javanese-leadership-culture-for-primary-school-principal');
